import s from './Info.module.css';
import Preloader from "../../common/preloader/preloader";

const Info = (props) => {

    if (!props.profile) {
        return <Preloader />
    }

    return (
        <div className={s.info}>
            {/*<div className={s.photo}>*/}
            {/*    <img alt='img' src='/img/freddie2.jpeg'/>*/}
            {/*</div>*/}

            <div className={s.photo}>
                <img alt='img' src={props.profile.photos.large}/>
            </div>

            <div className={s.photoInfo}>
                {/*<h3>Freddie Mercury</h3>*/}
                <h3>{props.profile.fullName}</h3>

                {/*<p>*/}
                {/*    <span className={s.userInfo}>Looking for a job:</span><p>{(props.profile.lookingForAJob) ? 'yes' : 'no' }</p><br/>*/}
                {/*    <span className={s.userInfo}>City:</span> London<br/>*/}
                {/*    <span className={s.userInfo}>Nationality:</span> British<br/>*/}
                {/*    <span className={s.userInfo}>About me:</span> {props.profile.aboutMe}<br/>*/}
                {/*</p>*/}
            </div>



            <div className={s.user}>
                <div className={s.userQuestion}>
                    <ul>
                        <li>Looking for a job:</li>
                        <li>City:</li>
                        <li>Nationality:</li>
                        <li>About me:</li>
                    </ul>
                </div>

                <div className={s.userAnswer}>
                    <ul>
                        <li>{(props.profile.lookingForAJob) ? 'yes' : 'no' }</li>
                        <li>London</li>
                        <li>British</li>
                        <li>{props.profile.aboutMe}</li>
                    </ul>
                </div>
            </div>
        </div>




    )




}

export default Info;
